define('services/RestAPIService',['angular', 'restangular'], function(angular) {
  
  var factory = function(API, $log, Restangular) {
    return Restangular.withConfig(function(RestangularConfigurer) {
      RestangularConfigurer
        .setBaseUrl(API.url)
        .setResponseExtractor(function(response) {
          if (typeof response.response !== 'undefined') {
            var newResponse = response.response;
            newResponse.meta = response.meta;
            newResponse.paging = response.paging;
            newResponse.error = response.error;
            return newResponse;
          }
          return response;
        })
        .setErrorInterceptor(function(response) {
          if (response.status === 401) {
            $log.error('unauthorized!');
          } else {
            $log.error('connection interrupted!');
          }
        });
    });
  };

  factory.$inject = ['API', '$log', 'Restangular'];
  return factory;
});

define('services/JSFeatService',[], function() {
  
  var factory = function($log) {
    function getMatrix(columns, rows, dataType) {
      columns = columns | 630;
      rows = rows | 480;
      dataType = dataType | jsfeat.U8_t | jsfeat.C1_t;
      return new jsfeat.matrix_t(columns, rows, dataType);
    }
    return {
      getMatrix: getMatrix
    };
  };

  factory.$inject = ['$log'];
  return factory;
});

define('services/TreeService',['angular'], function(angular) {
  

  var factory = function() {

    // Some fake testing data
    var chats = [{
      id: 0,
      name: 'Dub letn',
      lastText: 'Quercus robur',
      face: 'img/dub.jpg'
    }, {
      id: 1,
      name: 'Javor klen',
      lastText: 'Acer pseudoplatanus',
      face: 'img/javor.jpg'
    }, {
      id: 2,
      name: 'Ole lepkav',
      lastText: 'Alnus glutinosa',
      face: 'img/olse.jpg'
    }, {
      id: 3,
      name: 'Jablo domc',
      lastText: 'Malus domestica',
      face: 'img/jablon.jpg'
    }, {
      id: 4,
      name: 'Buk lesn',
      lastText: 'Fagus sylvatica',
      face: 'img/buk.jpg'
    }];

    return {
      all: function() {
        return chats;
      },
      remove: function(chat) {
        chats.splice(chats.indexOf(chat), 1);
      },
      get: function(chatId) {
        for (var i = 0; i < chats.length; i++) {
          if (chats[i].id === parseInt(chatId)) {
            return chats[i];
          }
        }
        return null;
      }
    };

  };

  factory.$inject = [];
  return factory;
});

define('services/services',['require','angular','services/CameraService','services/RestAPIService','services/JSFeatService','services/TreeService'],function(require) {
  

  var angular = require('angular'),
    services = angular.module('listy.services', ['restangular']);

  services.service('CameraService', require('services/CameraService'));
  services.service('api', require('services/RestAPIService'));
  services.service('feat', require('services/JSFeatService'));
  services.service('TreeService', require('services/TreeService'));

  return services;

});

